import React, {useState, useEffect} from 'react';
import './App.css';
import axios from 'axios'

const App = () => {

  const [result, setResult] = useState("");

  useEffect(() => {
    const res = axios.post('https://localhost:5001/run', {
      content: "Hello API",
      language: "viz"
    });
    setResult(res.data);
  }, [])

  return (
    <div>
      <text>{result}</text>
    </div>
  );
}

export default App;
